import {
    createBrowserRouter,
} from "react-router-dom";
import App from "../App";
import User from "../pages/User";
import Config from "../pages/Config";

const router = createBrowserRouter([
    {
        path: "/",
        element: <App />,
    },
    {
        path: "/user",
        element: <User />
    },
    {
        path: "/config",
        Component: <Config />
    }
]);

export default router;
